import React from 'react'
import { Row, Col, CardBody, Card, Progress } from "reactstrap";
//import LineChart from "./line-chart"
//import RevenueChart from "./revenue-chart"
import FormXeditable from './Forms/FormXeditable';

const  AddDoctor = ()=> {
  return (
    <React.Fragment>
    <div className="page-content">
       
        <Row>
          <div className="col-12">
            <div className="page-title-box d-flex align-items-center justify-content-between">
              <h4 className="page-title mb-0 font-size-18">Add Doctor</h4>

              <div className="page-title-right">
                <ol className="breadcrumb m-0">
                  <li className="breadcrumb-item active">Welcome to BetterHospital</li>
                </ol>
              </div>

            </div>
          </div>
        </Row>
     
      
                         
            <FormXeditable />
              
        
     
    </div>
    
    </React.Fragment>
  )
}



export default AddDoctor;
